import { Component,OnInit } from '@angular/core';
import { AppService} from 'src/app/servicios/App.service';
import { AfiliadoInter } from 'src/app/interface/DatosAfiliado';
import Swal from 'sweetalert2';



@Component({
  selector: 'app-lista-afiliados',
  templateUrl: './lista-afiliados.component.html',
  styleUrls: ['./lista-afiliados.component.css']
})
export class ListaAfiliadosComponent implements OnInit {


  afiliadoArray:AfiliadoInter[];

  constructor(private ServiceApp:AppService ){
    this.afiliadoArray=[]
  }


  ngOnInit(): void {

    this.getAfiliados();

  }

  getAfiliados(){

    this.ServiceApp.getAfiliados().subscribe(
      res=>{
        this.afiliadoArray=<any>res;
        this.afiliadoArray.map(i =>{
         i.edad = this.getEdad((i.fecha_nacimiento));      

        })


      },
      err => console.log(err)

    )
  }

eliminar(id:any){
  this.ServiceApp.deleteAfiliado(id).subscribe(
    res => {
      Swal.fire({
        position: 'top',
        icon: 'success',
        title: 'usuario eliminado',
        showConfirmButton: false,
        timer: 1000
      })
      this.getAfiliados();

    },
    err=> (
      Swal.fire({
        icon: 'error',
        title: 'Oops...',
        text: 'no se logro eleiminar el usuario!',
        // footer: '<a href="">Why do I have this issue?</a>'
      })
    )

  )

}


 getEdad(fecha:any) {
  let hoy = new Date()
  let fechaNacimiento = new Date(fecha)
  let edad = hoy.getFullYear() - fechaNacimiento.getFullYear()
  let diferenciaMeses = hoy.getMonth() - fechaNacimiento.getMonth()
  let diferenciadias= hoy.getDay() - fechaNacimiento.getDay()

  if (
    diferenciaMeses < 0 ||
    (diferenciaMeses === 0 && hoy.getDate() < fechaNacimiento.getDate())
  ) {
    return `Fecha Invalidas`;

  }

  if(edad == 0 && diferenciaMeses > 0){
    return `${diferenciaMeses} meses`;
  }else if(edad == 0 && diferenciaMeses ==0 && diferenciadias >= 0){
    return `${diferenciadias} dias`;
  }
  return `${edad} años`;
}

}
<h1 class="text-center">LISTA DE AFILIADOS</h1>


<div class="container">
    <table class="table mt-5 table-striped table-hover">

    <thead>
    <tr>
      <!-- <th class ="text-center" scope="col">#</th> -->
      <th class ="text-center" scope="col">CC</th>
      <th class ="text-center" scope="col">Nombre</th>
      <th class ="text-center" scope="col">Apellidos</th>
      <th class ="text-center" scope="col">Fecha afiliacion</th>
      <th class ="text-center" scope="col">Edad</th>
      <th class ="text-center" scope="col">Nvel sisben</th>
      <th class ="text-center" scope="col">Direccion</th>
      <th class ="text-center" scope="col">Telefono</th>
      <th class ="text-center" scope="col">Acciones</th>
    </tr>
  </thead>
  <tbody>
    <tr *ngFor="let afiliado of afiliadoArray">
     <!-- <td class ="align-middle text-center">{{afiliado.id_afiliado}}</td> -->
     <td class ="align-middle text-center">{{afiliado.CC}}</td>
     <td class ="align-middle text-center">{{afiliado.nombre}}</td>
     <td class ="align-middle text-center">{{afiliado.apellidos}}</td>
     <td class ="align-middle text-center">{{afiliado.fecha_afiliacion | date:'yyyy-MM-dd ' }}</td>
     <td class ="align-middle text-center">{{afiliado.edad}}</td>
     <td class ="align-middle text-center">{{afiliado.puntaje_sisben}}</td>
     <td class ="align-middle text-center">{{afiliado.direccion}}</td>
     <td class ="align-middle text-center">{{afiliado.telefono}}</td>
     <th> <div class="d-flex justify-content-between">
    <button type="button" class ="btn btn-danger " (click)="eliminar(afiliado.id_afiliado)">Eliminar</button>
    <button class="btn btn-info px-3 py-2" type="button" [routerLink]="['../editar',afiliado.id_afiliado]">Actualizar</button>
    </div></th>
    </tr>
  </tbody>
</table>

</div>
